import React from "react";
import { Link } from 'react-router-dom';

const Nav = () => {
  return (
    <nav className="navbar navbar-expand-lg" id="nav">
      <div className="container">
        <Link to="/" className="title navbar-brand">Product List</Link>

        <div className="d-grid gap-2 d-md-flex justify-content-md-end">
          <Link to="/add" className="btn btn-primary me-md-2" type="button">ADD</Link>
          <button className="btn btn-danger" type="button">MASS DELETE</button>
        </div>
      </div>
    </nav>
  );
};

export default Nav;
